    'Кот Евгений',
    'Пётр Игрь',
    'Такса Сережа',
    'Лось Альберт',
    'Книга Мария',
    'Никнэйм Рома',
    'American spy',
    '这是怎么回事',
  ]
}
export default function dialogList(state = list, action) {
  if (action.type === 'LOAD_DIALOG'){
  return state;
  }
  return state;
}
